import './App.css';
import {BrowserRouter, Route, Routes} from "react-router-dom";
import Main from "./pages/Main";
import Header from "./pages/Header";

function App() {
    return (
        <div className={'container my-4'}>
            <Header />
            <br/>
            <Main />
        </div>
    );
}

export default App;
